export enum TICKET_STATUS_TYPES {
  PENDING = 'Pending',
  STARTED = 'Started',
  IN_REVIEW = 'In Review',
  DONE = 'Done',
}

export enum TICKET_ACTION_TYPES {
  ADD_TICKET = 'Add Ticket'
}
